    false,nt"url": null,nt"notes": "In 2002 and 2003, as part of an effort
    to characterize bird habitat, vegetation at Big Muddy National Fish and Wildlife
    Refuge was sampled in three very coarse vegetation types. In 2007, limited funds
    were made available by the USGS-Columbia Environmental Research Center to establish
    and collect data at permanent vegetation monitoring plots at Big Muddy. This study
    provided the baseline data necessary to begin tracking long-term ecological change
    on the refuge.",nt"license_title": "License Not Specified",nt"extras":
